, "OfficeHour"=>[{"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Monday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Tuesday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Wednesday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"7:00 PM", "Day"=>"Thursday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Friday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Saturday"}, {"OpenTime"=>"11:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Sunday"}], "LongDescription"=>"Is there such a thing as too much? We think the question is: What do you want to do first? Lounge by the pool? Mix and mingle in the courtyard? Or invite your friends over for games in the resident lounge? (We like to think of it as sharing, not showing off.) Whatever tickles your fancy, when you live here, you actually get to enjoy more of itnot just because you are close to everything, but because your new home is all thatand then some. Here is the quick and short of it: It is all about access, and you have itfrom easy commutes to DC, to even easier shopping at Wegmans, Whole Foods, Tysons Corner and more. We have lots and lots of space with open layouts, high 9 ceilings, dens and lofts. And a slew of studio, one- and two-bedroom floor plans to choose from. So pick the one that suits your lifeand simply stretch out and relax. Let us just say that our finishes and design rival what you would expect to find at top-of-the-line condo buildings. From kitchens boasting quartz countertops, ", "DrivingDirections"=>nil}, "Policy"=>{"Pet"=>[{"type"=>"Dog", "allowed"=>"true", "Comment"=>nil}, {"type"=>"Cat", "allowed"=>"true", "Comment"=>nil, "Fee"=>"500", "Rent"=>"45"}], "General"=>"No more than two animals are allowed per apartment. Aggressive breeds will not be allowed (see list below). Prior approval from management will be required by providing a photo of all dogs and by scheduling a pet interview. Current vaccination records are required prior to move in. A $500 pet