ay"=>"Monday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Tuesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Wednesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Thursday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Friday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Saturday"}, {"OpenTime"=>"0:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Sunday"}], "LongDescription"=>"Located in the heart of North Bethesda, only minutes from I-495 and I-270 in Montgomery County, your new home at Oxford Square is the perfect combination of serenity and excitement. Prefer not to walk to all that is nearby? Bus stops are located at our community, including a Metrobus stop providing access to the White Flint Metro! Our location is also ideal for NIH, Bethesda Naval Hospital and NRC employees. Along with the convenience of an excellent location, the abundance of on-site amenities and features at your new home offer a unique selection in the area that you will only find at Oxford Square, including controlled access entry, individual washers and dryers, modern eat-in kitchens, balconies and patios, a swimming pool, a fitness center, playground and picnic areas with grills in a beautiful setting with oak accents, picnic areas, and wooded views. Not only do we allow pets, but our pet fees are among the lowest around.", "DrivingDirections"=>"From Washington, DC or the Beltway, go North on Rockville Pike (Route 355), then right on Nicholson lane.  Proceed through 4 lights to Oxford Square entrance on right.  Or, go West on Viers Mill Road, turn left on Randolph Road and then left on Parklawn Drive to Oxford Square entrance (2nd driveway on left)."}, "Policy"=>{"Pet"=>[{"type"=>"Dog", "allowed"=>"true", "Comment"=>nil, "Fee"=>"350", "Rent"=>"50"}, {"type"=>"Cat", "allowed"=>"true", "Comment"=>nil, "Fee"=>"350", "Rent"=>"50"}], "General"=>"Breed Restrictions Apply.  Up to 2 pets per home. No aggressive breeds and/or exotic pet