 "Day"=>"Saturday"}, {"OpenTime"=>"12:00 PM", "CloseTime"=>"5:00 PM", "Day"=>"Sunday"}], "LongDescription"=>"Enjoy the finest in Alexandria, VA apartment living at Mount Vernon Square Apartments. Garden-style, corporate furnished, and completely renovated apartments for rent are available, some featuring fireplaces, an in-home washer/dryer, and extra storage. You'll also benefit from first-class amenities, especially our 2,600-square-foot gym with sauna, and adjacent pool, on-site daycare, and free parking. * Located in the renowned Fairfax County School District, you will enjoy our huge playground or walking your pet in our dog park. Numerous shopping destinations, restaurants, and tourist attractions are close by, including Old Town Alexandria, National Harbor, George Washington's Mount Vernon, and the new Costco. Mount Vernon Square is minutes from DC, the Pentagon, Bolling Air Force Base, and Ft. Belvoir. With express bus service to Huntington Metro Station and convenient access to I-95 and I-495, your commute will be easy! Military discounts are available.", "DrivingDirections"=>"From I-95, take Exit 1 (Route 1 South). Continue 3.5 miles and turn left onto Arlington Drive. Follow the signs to the leasing office."}, "Policy"=>{"Pet"=>[{"type"=>"Dog", "allowed"=>"true", "Comment"=>nil}, {"type"=>"Cat", "allowed"=>"true", "Comment"=>nil}], "General"=>"Cats and dogs are welcome.  Maximum two pets per apartment. Monthly fees: $25 per pet. Refundable deposit: $100 per cat, $150 per dog, $300 per large dog. Non-refundable Fee: $100 per cat, $150 per dog, $300 per large dog. Breed restrictions and other limitations apply.  No weight limit."}, "Floorplan"=>[{"id"=>"193885", "Name"=>"1 Bedroom, 1 Bath 665 sq. ft.", "Comment"=>nil, "Room"=>[{"type"=>"bathroom", "Count"=>"1"}, {"type"=>"bedroom", "Count"=>"1"}], "SquareFeet"=>{"min"=>"665", "max"=>"665"}, "MarketRent"=>{"min"=>"1200.00", "max"=>"1588.00"}, "Deposit"=>{"type"=>"security deposit", "Amount"=>"175"}, "Amenitie